import React from "react";
import { NavLink } from "react-router-dom";

export default function Navbar() {
  return (
    <div>
      <li>
        <NavLink to="/countries">Inicio</NavLink>
      </li>
      <li>
        <NavLink to="/Create">Crear Actividad</NavLink>
      </li>
    </div>
  );
}
